(18, 1, '2016-03-07 23:12:04', '2016-03-07 21:12:04', 'Magor reveals artwork for debut album, a masterpiece by the one and only <a title=\"The Art of Dusty Peterson \" href=\"http://www.dustypeterson.net/\" target=\"_blank\">Dusty Peterson</a>.\r\n\"Drawn to the Dark\" is not yet distributed under any label and expected to be fully released soon.\r\n\r\n<a href=\"http://localhost/Magor-Old/site/wp-content/uploads/2016/03/drawntothedark.jpg\" rel=\"attachment wp-att-17\"><img class=\"alignnone size-medium wp-image-17\" src=\"http://localhost/Magor-Old/site/wp-content/uploads/2016/03/drawntothedark-300x300.jpg\" alt=\"drawntothedark\" width=\"300\" height=\"300\" /></a>', 'Magor Reveals Artwork For Debut Album', '', 'inherit', 'closed', 'closed', '', '16-revision-v1', '', '', '2016-03-07 23:12:04', '2016-03-07 21:12:04', '', 16, 'http://localhost/Magor-Old/site/uncategorized/16-revision-v1/', 0, 'revision', '', 0),
(19, 1, '2013-04-20 13:23:17', '2013-04-20 10:23:17', '<h5 data-ft=\"{&quot;type&quot;:1,&quot;tn&quot;:&quot;K&quot;}\">To whom it may concern,</h5>\r\nLast Thursday we had a show in Ra\'anana (our home town)\r\nUnfortunately we went on for one song and then were forced to leave the stage due to time limits.\r\nWe appreciate the efforts of the promoter, the soundman ,the other bands and the protest the crowd gave.\r\n\r\nYou can still catch us at the 4th annual TEL AVIV DEATHFEST on May 16th\r\n<a href=\"https://www.facebook.com/events/432946073434007\" target=\"_blank\" rel=\"nofollow\">https://www.facebook.com/events/432946073434007</a>\r\n\r\nביום חמישי האחרון הייתה לנו הופעה ברעננה, העיר שבה הוקמה הלהקה.\r\nלצערנו הורידו אותנו מהבמה אחרי שיר אחד בלבד. ברצוננו להודות למפיק האירוע, לסאונד מן, ולקהל שהיה וגם ניסה להחזיר אותנו לבמה.\r\nאתם עדיין יכולים לראות אותנו בתל אביב דת\'פסט 4 ב16 למאי', 'Absolute Carnage 3 show canceled!!!', '', 'publish', 'closed', 'open', '', 'absolute-carnage-3-show-canceled', '', '', '2016-03-07 23:12:56', '2016-03-07 21:12:56', '', 0, 'http://localhost/Magor-Old/site/?p=19', 0, 'post', '', 0),
(20, 1, '2016-03-07 23:12:56', '2016-03-07 21:12:56', '<h5 data-ft=\"{&quot;type&quot;:1,&quot;tn&quot;:&quot;K&quot;}\">To whom it may concern,</h5>\r\nLast Thursday we had a show in Ra\'anana (our home town)\r\nUnfortunately we went on for one song and then were forced to leave the stage due to time limits.\r\nWe appreciate the efforts of the promoter, the soundman ,the other bands and the protest the crowd gave.\r\n\r\nYou can still catch us at the 4th annual TEL AVIV DEATHFEST on May 16th\r\n<a href=\"https://www.facebook.com/events/432946073434007\" target=\"_blank\" rel=\"nofollow\">https://www.facebook.com/events/432946073434007</a>\r\n\r\nביום חמישי האחרון הייתה לנו הופעה ברעננה, העיר שבה הוקמה הלהקה.\r\nלצערנו הורידו אותנו מהבמה אחרי שיר אחד בלבד. ברצוננו להודות למפיק האירוע, לסאונד מן, ולקהל שהיה וגם ניסה להחזיר אותנו לבמה.\r\nאתם עדיין יכולים לראות אותנו בתל אביב דת\'פסט 4 ב16 למאי', 'Absolute Carnage 3 show canceled!!!', '', 'inherit', 'closed', 'closed', '', '19-revision-v1', '', '', '2016-03-07 23:12:56', '2016-03-07 21:12:56', '', 19, 'http://localhost/Magor-Old/site/uncategorized/19-revision-v1/', 0, 'revision', '', 0),
(21, 1, '2013-05-19 08:05:12', '2013-05-19 05:05:12', 'Magor would like to thank all the crazy crowd that came out to see us at the Tel Aviv Deathfest! Special thanks to Viscera Trail, all the other bands, Met Al Metal radio show, and all of our crowd and supporters.\r\nwe\'ll post some pictures &amp; videos soon...\r\n\r\nOur next show will be on june 13  at the Koro club TLV! see you there!\r\n\r\n<a href=\"https://www.facebook.com/events/302967833166896/\" target=\"_blank\">Facebook event</a>', 'DEATHFEAST IV', '', 'publish', 'closed', 'open', '', 'deathfeast-iv', '', '', '2016-03-07 23:14:56', '2016-03-07 21:14:56', '', 0, 'http://localhost/Magor-Old/site/?p=21', 0, 'post', '', 0),
