(39, 1, '2013-11-14 10:27:56', '2013-11-14 08:27:56', 'Magor was announced as the opening act for the \"Darkness over Tel-Aviv\" concert alongside Rotting Christ and Moonsorrow. The show will take place on 20th December 2013 at the Reading 3 venue.\r\n\r\n<a href=\"http://localhost/Magor-Old/site/wp-content/uploads/2016/03/1185446_660174847326066_1932746542_n.jpg\" rel=\"attachment wp-att-40\"><img class=\"alignnone size-medium wp-image-40\" src=\"http://localhost/Magor-Old/site/wp-content/uploads/2016/03/1185446_660174847326066_1932746542_n-420x300.jpg\" alt=\"1185446_660174847326066_1932746542_n\" width=\"420\" height=\"300\" /></a>', 'MAGOR opening act for Rotting Christ and Moonsorrow', '', 'publish', 'closed', 'open', '', 'magor-opening-act-for-rotting-christ-and-moonsorrow', '', '', '2016-03-07 23:21:49', '2016-03-07 21:21:49', '', 0, 'http://localhost/Magor-Old/site/?p=39', 0, 'post', '', 0),
