(42, 1, '2013-12-31 10:01:03', '2013-12-31 08:01:03', 'Established in 2002. After being the opening act for leading artists such as ROTTING CHRIST,SEPTIC FLESH &amp; MOONSORROW, After releasing 2 singles in 2009 and 2010, After being broadcasted on radio and TV shows and dozens of concerts - Comes the biggest of them all !!! This February 1st, MAGOR will be releasing their first full length album entitled \"DRAWN TO THE DARK\" in an unforgettable, dark, bone crushing full length concert and will perform the entire album!\r\n\r\nJust to make sure we crush all of your bones, we have brought a few guest appearances: Moti \"Spawn\" Rokah - SPAWN OF EVIL Yuval Talmor - LEHAVOTH Oren Balbus - ETERNAL GREY\r\n\r\nIn 2006 MAGOR has been the opening act for the black metal band, AZAMOTH, debut album release. 8 years passed by and AZAMOTH are still delivering 100%, non compromising pure black metal and will be the opening act for this show!\r\n\r\nEntrance at the doors will be at the low price of 30 NIS so you guys can splurge on a beer or the MAGOR CD and T-Shirts.\r\n\r\nSO LIGHT UP YOUR TORCHES BECAUSE IT\'S GOING TO GET DARK!', 'MAGOR debut album release concert Levontin 7 Tel-Aviv', '', 'publish', 'closed', 'open', '', 'magor-debut-album-release-concert-levontin-7-tel-aviv', '', '', '2016-03-07 23:22:25', '2016-03-07 21:22:25', '', 0, 'http://localhost/Magor-Old/site/?p=42', 0, 'post', '', 0),
